import React from "react";

const ViewEmployee = (props) => {
  const { empDetails } = props.location.state;

  // Now you can access empDetails.empid, empDetails.ename, etc. to display the details
  return (
    <div>
      <h1>Employee Details</h1>
      <p>Employee ID: {empDetails.empid}</p>
      <p>Name: {empDetails.ename}</p>
      <p>Designation: {empDetails.designation}</p>
      <p>Joining Date: {empDetails.jdate}</p>
      <p>Status: {empDetails.status}</p>
      {/* You can render other details similarly */}
    </div>
  );
};

export default ViewEmployee;
